import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from './home';
import Test from './test';

const Main = () => (
    <Switch>
        <Route exact path ='/' component = { Home } />
        <Route path ='/test' component = { Test } />
    </Switch>
)

export default Main;
